import { FC } from 'react';
import './styles/component.css';
import './styles/dashboard.css';

import Card from 'react-bootstrap/Card';

const Calendar: FC = () => {
    return (
        <div className='info display-in-row-wrap'>
            <Card style={{ width: '18rem' }}>
                <Card.Body>
                    <Card.Title>Root of Nightmares Raid</Card.Title>
                    <Card.Text>
                    Week 2 on March 10
                    </Card.Text>
                </Card.Body>
            </Card>
            <Card style={{ width: '18rem' }}>
                <Card.Body>
                    <Card.Title>GM Nightfalls</Card.Title>
                    <Card.Text>
                        Week 7 on April 11
                    </Card.Text>
                </Card.Body>
            </Card>
        </div>
    );
};

export default Calendar;
